import React from 'react';

const ChangeBooking = () => {
    return (
        <div className="min-h-screen bg-white text-black py-10 px-4 max-w-4xl mx-auto">
            <h1 className="text-3xl font-bold text-pink-600 mb-6">How do I change my booking?</h1>

            <p className="mb-4">
                Changing your booking is quick and easy. You can modify your itinerary through your account on our website.
                Follow the simple steps below to make changes to your booking. Additional charges may apply based on the fare rules.
            </p>

            <ul className="list-disc pl-6 space-y-2 text-gray-700">
                <li>Log in to your account using your credentials.</li>
                <li>Navigate to the <strong>My Bookings</strong> section.</li>
                <li>Select the booking you wish to modify.</li>
                <li>Click on <strong>Change</strong> and follow the instructions to update your booking.</li>
            </ul>

            <p className="mt-6 text-sm text-gray-500">
                For urgent booking changes or further assistance, please contact our support team through live chat or phone, available 24/7.
            </p>
        </div>
    );
};

export default ChangeBooking;
